import React from 'react';
import './App.css';
import Navbar from './componets/Navbar'
import {BrowserRouter as Router, Switch ,Route} from 'react-router-dom';
import '../public/images';
function App() {
  return (
    <Router>
      <Navbar />
      <Switch>
          <Route path='/' exact/>
      </Switch>
    </Router>
  );
}

export default App;
